script: |
  super -f text -I q13820.spq | sort > q13820.out

inputs:
  - name: q13820.spq
    data: |
      SELECT DISTINCT - - 2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT IN ( - 13, - col1, + col1, + 60 / + col0, - - 81 / + + ( + col0 ), - col1 );
  - name: tab1

outputs:
  - name: q13820.out
    data: |
      2
